import React from "react";

import Header from "../partials/Header";
import Footer from "../partials/Footer";

function GetRhythmPrivacy() {
  return (
    <div className="flex flex-col min-h-screen overflow-hidden">
      {/*  Site header */}
      <Header />

      {/*  Page content */}
      <main className="flex-grow">
        {/*  Page sections */}
        <div className="text-sm text-gray-500 text-center mt-3">
          <h1>Linc Privacy Policy</h1>
          <p>
            Linc was developed by Samuel Coe as a paid app. This app is provided
            through Apple's App Store and is intended for use as is.
          </p>
          <h2>Data storage</h2>
          <p>
            Linc does not collect nor share any data from its users. All data
            provided to Linc is stored locally using Apple's CoreData container.
            In order to keep data in sync between your devices, this app uses
            Apple's CloudKit container.
          </p>
          <h2>Contact information</h2>
          <p>
            Any questions regarding this policy may be directed to{" "}
            <a href="mailto:sam@linc.app">sam@linc.app</a>
          </p>
          <h2>Changes to this policy</h2>
          <ul>
            <li>
              <b>05/19/2020</b> - Policy V1
            </li>
          </ul>
        </div>
      </main>

      {/*  Site footer */}
      <Footer />
    </div>
  );
}

export default GetRhythmPrivacy;
